// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

contract Auction {
    string public item;
    uint public endTime;
    address public owner;
    address public highestBidder;
    uint public highestBid;
    bool public ended;

    mapping(address => uint) public bids;
    address[] public bidders;

    event BidPlaced(address indexed bidder, uint amount);
    event AuctionEnded(address winner, uint amount);
    event Withdrawn(address indexed bidder, uint amount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    constructor(string memory _item) {
        item = _item;
        owner = msg.sender;
        endTime = block.timestamp + 3 days;
    }

    function bid() external payable {
        require(block.timestamp < endTime, "Auction ended");
        require(msg.value > highestBid, "Bid too low");

        if (bids[msg.sender] == 0) {
            bidders.push(msg.sender);
        }

        bids[msg.sender] += msg.value;
        highestBid = bids[msg.sender];
        highestBidder = msg.sender;

        emit BidPlaced(msg.sender, msg.value);
    }

    function withdraw() external {
        require(msg.sender != highestBidder, "Winner cannot withdraw");
        uint amount = bids[msg.sender];
        require(amount > 0, "Nothing to withdraw");
        bids[msg.sender] = 0;
        payable(msg.sender).transfer(amount);
        emit Withdrawn(msg.sender, amount);
    }

    function endAuction() external onlyOwner {
        require(!ended, "Already ended");
        require(block.timestamp >= endTime, "Auction not over yet");
        ended = true;

        if (highestBidder != address(0)) {
            payable(owner).transfer(highestBid);
            emit AuctionEnded(highestBidder, highestBid);
        }
    }

    function getTimeLeft() external view returns (uint) {
        if (block.timestamp >= endTime) return 0;
        return endTime - block.timestamp;
    }

    function getBidders() external view returns (address[] memory) {
        return bidders;
    }
}

contract BatchDeployAuction {
    Auction[] public auctions;
    address public owner;

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function deployAll(uint count) public onlyOwner {
        require(count > 0, "Count must be > 0");
        for (uint i = 1; i <= count; i++) {
            string memory itemName = string(abi.encodePacked("Item_", uint2str(i)));
            Auction a = new Auction(itemName);
            auctions.push(a);
        }
    }

    function deploySingle(string memory name) public onlyOwner {
        Auction a = new Auction(name);
        auctions.push(a);
    }

    function get(uint index) public view returns (address) {
        require(index < auctions.length, "Invalid index");
        return address(auctions[index]);
    }

    function getAll() public view returns (address[] memory) {
        address[] memory result = new address[](auctions.length);
        for (uint i = 0; i < auctions.length; i++) {
            result[i] = address(auctions[i]);
        }
        return result;
    }

    function deleteAuction(uint index) public onlyOwner {
        require(index < auctions.length, "Invalid index");
        auctions[index] = auctions[auctions.length - 1];
        auctions.pop();
    }

    function auctionsCount() public view returns (uint) {
        return auctions.length;
    }

    function uint2str(uint _i) internal pure returns (string memory str) {
        if (_i == 0) return "0";
        uint j = _i; uint len;
        while (j != 0) { len++; j /= 10; }
        bytes memory bstr = new bytes(len);
        uint k = len;
        while (_i != 0) { k--; bstr[k] = bytes1(uint8(48 + _i % 10)); _i /= 10; }
        str = string(bstr);
    }
}

